  false,\n\t\"url\": null,\n\t\"notes\": \"Agriculture Production Poultry Slaughtering
  and Processing in the United States This dataset consists of facilities which engage
  in slaughtering, processing, and/or warehousing for the purpose of producing poultry
  and egg products. Facilities where poultry is raised or where eggs are laid are
  not included in this dataset, as they are included in a separate layer. TGS was
  not tasked with ensuring the completeness of this layer. The source data used for
  this data layer does not include any facilities in American Samoa, the US Virgin
  Islands, or Wyoming. Records with '-DOD' appended to the end of the [NAME] value
  are located on a military base, as defined by the Defense Installation Spatial Data
  Infrastructure (DISDI) military installations and military range boundaries. At
  the request of NGA, text fields in this dataset have been set to all upper case
  to facilitate consistent database engine search results. At the request of NGA,
  all diacritics (e.g., the German umlaut or the Spanish tilde) have been replaced
  with their closest equivalent English character to facilitate use with database
  systems that may not support diacritics. The currentness of this dataset is indicated
  by the [CONTDATE] field. Based upon this field, the oldest record dates from 01/22/09
  and the newest record dates from 07/10/09.\",\n\t\"license_title\": \"License Not
